import React, { useEffect, useState } from 'react'
import { useLocation, useNavigate } from 'react-router-dom'

function SelectResults() {
    const [year, setYear] = useState(null)
    const [branch, setBranch] = useState(null)
    const [heldin, setHeldin] = useState(null)
    const [step2, setStep2] = useState(false)

    const navigate = useNavigate()
    const location = useLocation()

    useEffect(()=>{
        console.log(location.state)
        if(location.state == null ){
          window.alert('Not logged in')
          navigate('/Teacher/Teacherlogin')
        }
      })

    const clickHandler = () =>{
        if(year && branch && heldin){
            console.log(year,branch, heldin)
            navigate('/Teacher/Results/Add', {state:{'year': year, 'branch':branch, 'heldin': heldin, 'user': location.state.name}})
        }
        else{
            window.alert('Select all fields')
        }
        
    }

  return (
    <div>
        {step2 ? <div>sdasd</div>: <div>
        <h2>Logged in as: {location.state.name}</h2>
        <div>
            <h1>Enter Year</h1>
            <select onChange={(e) => setYear(e.target.value)}>
                <option value="">Select year</option>
                <option>FE</option>
                <option>SE</option>
                <option>TE</option>
                <option>BE</option>
            </select>
        </div>
        <div>
            <h1>Enter Branch</h1>
            <select onChange={(e) => setBranch(e.target.value)}>
                <option value="">Select branch</option>
                <option>IT</option>
                <option>CS</option>
                <option>AIDS</option>
            </select>
        </div>
        <div>
            <h1>Enter Heldin</h1>
            <select onChange={(e) => setHeldin(e.target.value)}>
                <option value="">Select held in</option>
                <option>2020</option>
                <option>2021</option>
                <option>2022</option>
                <option>2023</option>
            </select>
    
        </div>
        <div>
            <button type='button' onClick={() => {
                if(year && branch && heldin){
                    setStep2(true)
                }
                else{
                    window.alert('Select all fields')
                }}}>Next ></button>
        </div>
        </div>}
    </div>
  )
}

export default SelectResults
